import React, { Component } from "react";
import ProductsTable from "../components/ProductsTable";

class DetailsPage extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }
  render() {
    return <ProductsTable productsData={this.props.data} />;
  }
}

export default DetailsPage;
